import React,{useState,useEffect} from 'react'
import { Link } from 'react-router-dom'
import classes from './RegisterForm.module.css'
import eye from "../assets/Auth/Form/eyebtn.png";


export default function RegisterForm() {

    const [focusFirst, setFocusFirst] = useState(false);
    const [focusLast, setFocusLast] = useState(false);

    const [focus, setFocus] = useState(false);

    const [focus2, setFocus2] = useState(false);

    const [focus3, setFocus3] = useState(false);

    const [showPassword, setShowPassword] = useState(false);

    const [showRetypePassword, setShowRetypePassword] = useState(false);

const [firstName,setFirstName]=useState('');
const [lastName,setLastName]=useState('');
const [email,setEmail]=useState('');


const [emailError,setEmailError]=useState(false);
const [firstNameError,setFirstNameError]=useState(false);

    useEffect(() => {
        setTimeout(() => {
            setFocusFirst(false);

        }, 3000);
      }, [focusFirst]);

      useEffect(() => {
        setTimeout(() => {
            setFocusLast(false);

        }, 3000);
      }, [focusLast]);

      useEffect(() => {
        setTimeout(() => {
            setFocus(false);

        }, 3000);
      }, [focus]);

      useEffect(() => {
        setTimeout(() => {
            setFocus2(false);

        }, 3000);
      }, [focus2]);

      useEffect(() => {
        setTimeout(() => {
            setFocus3(false);

        }, 3000);
      }, [focus3]);

    const handleShowPassword = () => {
        setShowPassword(!showPassword);
      };

      const handleShowRetypePassword = () => {
        setShowRetypePassword(!showRetypePassword);
      };



const handlerFirstName=(event)=>{
    setFirstName(event.target.value);
    if( event.target.value.length < 3 ){
      setFirstNameError(true);
      LOG
      }else{
        setFirstNameError(false);
      }
}
const handlerLastName=(event)=>{
    setLastName(event.target.value);
}
const handlerEmail=(event)=>{
    setEmail(event.target.value);
    if( !event.target.value.includes('@') ){
        setEmailError(true);
    }else{
        setEmailError(false);
    }
}

const handlerRegisterData=(e)=>{
    e.preventDefault();
    const RegisterData={
        firstName:firstName,
        lastName:lastName
    }
    console.log(RegisterData);
}
  return (
    <form onSubmit={handlerRegisterData}>
      <h2>Register to Tremplin-OC</h2>
      <p className={classes.parag}>Enter your details below</p>

    <div className={classes.displayFlex}>

      <div className={classes.wrapper__inpFirst}>
        <input
          className={`${classes.inpFirst} ${firstNameError ? classes.bordred:""  }`}
          type="text"
          placeholder="First name"
          onInput={() => setFocusFirst(true)}
          value={firstName}
          onChange={handlerFirstName}
        />
        <span className={`${classes.noblock} ${focusFirst && 
              classes.inp1__userid} ${firstNameError ? classes.red:""  } `}>
          First name
        </span>
      </div>

      <div className={classes.wrapper__inpLast}>
        <input
          className={`${classes.inpLast} `}
          type="text"
          placeholder="Last name"
          onInput={() => setFocusLast(true)}
          value={lastName}
          onChange={handlerLastName}
        />
        <span className={`${classes.noblock} ${focusLast && classes.inp1__userid}`}>
          Last name
        </span>
      </div>
      </div>



      <div className={classes.wrapper__inp1}>
        <input
          className={`${classes.inp1} ${emailError ? classes.bordred:""  }`}
          type="email"
          placeholder="Email address"
          onInput={() => setFocus(true)}
          value={email}
          onChange={handlerEmail}

        />
        <span className={`${classes.noblock} ${focus &&
            classes.inp1__email} ${emailError ? classes.red:""  } `}>
          Email address
        </span>
      </div>

      <div className={classes.wrapper__inp2}>
        <input
          className={classes.inp2}
          type={showPassword ? "text" : "password"}
          placeholder="Password"
          onInput={() => setFocus2(true)}
        />
        <div className={classes.wrapperEye} onClick={handleShowPassword}>
          <img src={eye} alt="eye" />
        </div>
        <span
          className={`${classes.noblock} ${focus2 && classes.inp2__password}`}
        >
          Password
        </span>
      </div>

      <div className={classes.wrapper__inp2}>
        <input
          className={classes.inp2}
          type={showRetypePassword ? "text" : "password"}
          placeholder="Retype password"
          onInput={() => setFocus3(true)}
        />
        <div className={classes.wrapperEye} onClick={handleShowRetypePassword}>
          <img src={eye} alt="eye" />
        </div>
        <span
          className={`${classes.noblock} ${focus3 && classes.inp2__password}`}
        >
         Retype password
        </span>
      </div>

      <div className={classes.fieldremember}>
        <label>
          <input className={classes.checkbox} type="checkbox" />{" "}
          <span className={classes.textremember}>Remember me</span>
        </label>
        <p className={classes.fieldremember__p}>Forgot password?</p>
      </div>
      <button type='submit' className={classes.btnLogin}>Register</button>
     <p className={classes.text}>By signing up, I agree to Minimal <span>Terms of Service</span>  and <span>Privacy Policy.</span></p>

      <p className={classes.parag2}>
      Already have account?{" "}
        <span className={classes.parag2__span}>
          {" "}
          <Link style={{textDecoration:'none'}} to="/">Sign in now!</Link>
        </span>
      </p>
    </form>
  )
}
